The various KDLScript attributes can be applied to structs to specify how they should be laid out , like so: @repr "transparent"
struct "MetersU32" { _ "u32"
} If no explicit @repr attribute is applied (the default, which is recommended), the struct will be eligible for repr combinatorics . Basically, we'll generate a version of the test where it's set to #[repr(C)] and version where it's set to #[repr(Rust)], improving your test coverage. It's up to each compiler / language to implement these attributes however they see fit . But for instance we would expect Rust backends to support both layouts, and C backends to bail on the Rust repr, producing twice as many rust-calls-rust test cases. Note that repr(transparent) is not currently eligible for repr combinatorics. If you want to test that, set it explicitly.

