KDLScript array types like [u32; 4] have the layout/repr you would expect from languages like C and Rust. But there's a problem with passing them by-value: C is supremely fucking weird about passing arrays by value if they're not wrapped in a struct. This is actually sugar for pass-by-reference (and largely decays into uint32_t*): void blah(uint32_t array[4]); And this doesn't even compile: uint32_t[4] blah(); // invalid syntax
